import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import { Col, Container, Row } from "react-bootstrap";

const Blogpage = () => {
  return (
    <>
      <Header />
      <Container>
        <Row>
            <Col>

            </Col>
            <Col>
                <h2>Recen</h2>
            </Col>
        </Row>
      </Container>
      <Footer />
    </>
  );
};

export default Blogpage;
